pragma solidity ^0.4.21;

import "installed_contracts/oraclize-api/contracts/usingOraclize.sol";

contract DieselPrice is usingOraclize {

    string public dieselPriceUSD;

    event LogInfo(string description);
    event NewDieselPrice(string price);

    constructor() public {
        OAR = OraclizeAddrResolverI(0x97f947b118617BEd811983833bA13c527ff05EcB);
        oraclize_setProof(proofType_TLSNotary | proofStorage_IPFS);
        update();
    }

    function __callback(bytes32 myid, string result, bytes proof) public {
        if(msg.sender != oraclize_cbAddress()) revert();
        emit NewDieselPrice(result);
        dieselPriceUSD = result;
    }

    function update() public payable {
        if(oraclize_getPrice("URL") > address(this).balance) {
            emit LogInfo("Oraclize query was NOT sent, please add some ETH to cover for the query fee");
        } else {
            emit LogInfo("Oraclize query was sent, standing by for the answer..");
            oraclize_query("URL", "xml(https://www.fueleconomy.gov/ws/rest/fuelprices).fuelPrices.diesel");
        }
    }

}
